const stringsToHash = (s1,s2) => {
    if (s1.length == 0 || s2.length == 0) return 0;

    var hash1 = s1.length;
    var hash2 = s2.length;

    for (i = 0; i < s1.length; i++) {
        char = s1.charCodeAt(i);
        hash1 = ((hash1 << 5) - hash1) + char;
    }

    for (i = 0; i < s2.length; i++) {
        char = s2.charCodeAt(i);
        hash2 = ((hash2 << 5) - hash2) + char;
    }

    return hash1 & hash2;
}
